import "./Navbar.css";
import navbarLogo from "../.././assets/navbar-logo.png"

function Navbar() {
    return (
        <div className="navbar">
            <img src={navbarLogo}/>
            <p>logo</p>
        </div>
    );
}

export default Navbar;
